import React from 'react'

class Operator extends React.Component {
    render() {
        let operators = [ '+', '-', '*', '/', '='];
        return (
           operators.map((operator) => {
            return(
                <button class="button-operator">
                    {operator}
                </button>
            )
           })
        )
    }
}

export default Operator
